import '../index.css';
import { Button } from './Button';
import '../App.css';
import './Main.css';


function Main() {
    return (
        <div className="">
            <div className="align-center justify-start">
                <h1 className='flex flex-col justify-center text-[#0ea5e9] text-8xl '>Hi! I'm Dev Patel</h1>
                <p className='text-xl text-gray-600'>Computer Science | Business | UNC</p>
                <Button buttonStyle='btn--primary' buttonSize='btn--large'>
                    DISCOVER MORE
                </Button>
            </div>
            <div className='align-center justify-end'>
                <image src="/images/tree.jpg" alt="me"></image>
            </div>
        </div>
    )
}

export default Main
